import React,{Component} from 'react';
import './App.css';

class App extends Component {
  state = {
    contacts: []
  }
  componentDidMount() {
    fetch('http://localhost:4000/properties')
    .then(res => res.json())
    .then((data) => {
      this.setState({ contacts: data })
    })
    .catch(console.log)
  }
  render() {
    return (
        <table>
          <thead>
          <th>Hello</th>
          </thead>
          <tbody>
          <tr>Heeeeee</tr>
          </tbody>
        </table>
    );
  }
}

export default App;
